import React from 'react'
import { Link } from 'react-router-dom';

function Header() {

    let arr = [
        {
            link : "link1"
        },
        {
            link : "link2"
        },
        {
            link : "link3"
        },
        {
            link : "link4"
        }
    ];

    return (
        <div>
           <div className="nav">
                {arr > 0 && arr.map(item => (
                                   <ul>
                                   <li>
                                        <Link to="/">
                                            <a href="">Anasayfa</a>
                                        </Link>
                                   </li>
                                   <li>
                                        <Link to="/iletisim">
                                            <a href="">{item.link}</a>
                                        </Link>
                                   </li>
                            </ul>
                ))}
            </div>
        </div>
    )
}

export default Header;
